import React, { Component } from "react";
import { NavLink } from "react-bootstrap";
import "./HomePage.scss";
import headerLogo from "../../Assets/Logos/logo.svg";
export default class HomePage extends Component {
  render() {
    return (
      <div className="home-wrapper">
        <div style={{ position: "static" }} className="ps-1">
          <div className="ps-content">
            <div className="banner landing-banner bg-landing">
              <header id="homepage-header">
                <div className="d-flex container align-items-center py-3">
                  <NavLink to="/home-page" className="brand">
                    <img src={headerLogo} alt="Listen-app" />
                  </NavLink>
                </div>
              </header>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
